import React, { Component } from "react";
import Menu from "./Component/Menu";

class App extends Component {
  state = {};
  render() {
    return (
      <BrowserRouter>
        <div className="rtl d-flex">
          <Menu />
          <Route exact path="/">
            <Home />
          </Route>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
